import React, { Component } from 'react'
import AddUser from './AddUser';


class User extends Component {

    constructor(props) {
        super(props)

        this.state = {
             User : {
                 name : '',
                 course:'',
                 email:'',
                 id :''
             }
        }
    }


    componentDidMount() {
      console.log(this.props.match.params.id);
      fetch(`http://localhost:9000/users/${this.props.match.params.id}`)
        .then((res) => res.json())
        .then((data) => {
          this.setState({
            User: data,
          });
          console.log(`${this.props.match.params.id}`);
        });
    }

    render() {
        return (
            <div>
                <AddUser />
            </div>
        )
    }
}

export default User
